  function setByte(
    int256 n,
    uint256 p,
    uint256 v
  ) internal pure returns (int256) {
    int256 i = n & int256(~(0xff << (8 * p)));
    return i | int256(v << (8 * p));
  }

  function getByte(int256 n, uint256 p) internal pure returns (int256) {
    return (n >> (8 * p)) & 0xff;
  }

  function getAttributeOfToken(uint256 tokenId, AttributeType attr)
    internal
    view
    returns (uint256[3] storage)
  {
    int256 index = getByte(tokensMetadata[tokenId], uint256(attr));
    return getArrayByAttr(attr)[uint256(index)];
  }

  function setAttributeOfToken(
    uint256 tokenId,
    AttributeType attr,
    uint8 index
  ) internal {
    tokensMetadata[tokenId] = setByte(
