  function random(uint256 max, uint256 sq) private view returns (uint256) {
    if (max == 0) {
      return 0;
    }

    return
      uint256(
        keccak256(abi.encodePacked(block.difficulty, block.timestamp, sq))
      ) % max;
  }

  function removeUnfilled(int256[] storage map, uint8 index) internal {
    if (map[0] == 0) {
      return;
    }

    int256 lastIndexValue = getByte(map[1], uint256(map[0] - 1));
    map[1] = setByte(map[1], index, uint256(lastIndexValue));
    map[1] = setByte(map[1], uint256(map[0] - 1), 0);

    map[0]--;
  }

