  function getAttributeValueByRange(AttributeType attr, uint256 tokenId)
    internal
    view
    returns (uint8)
  {
    if (tokenId >= 8666 && tokenId < 8671 && attr == AttributeType.Race) {
      return unfilledSpecialOverrides[0];
    } else if (
      tokenId >= 2103 && tokenId < 2108 && attr == AttributeType.Race
    ) {
      return unfilledSpecialOverrides[1];
    } else if (
      tokenId >= 6666 && tokenId < 6668 && attr == AttributeType.Race
    ) {
      return unfilledSpecialOverrides[2];
    } else if (
      tokenId >= 4520 && tokenId < 4530 && attr == AttributeType.Weight
    ) {
      return unfilledSpecialOverrides[3];
    } else if (
      tokenId >= 250 && tokenId < 255 && attr == AttributeType.Weight
    ) {
      return unfilledSpecialOverrides[4];
    } else if (
      tokenId >= 149 && tokenId < 159 && attr == AttributeType.Partner
    ) {
      return unfilledSpecialOverrides[5];
    } else if (tokenId >= 5295 && tokenId < 5296 && attr == AttributeType.IQ) {
      return unfilledSpecialOverrides[6];
    } else if (tokenId >= 1337 && tokenId < 1338 && attr == AttributeType.IQ) {
      return unfilledSpecialOverrides[7];
    } else if (
      tokenId >= 48 && tokenId < 53 && attr == AttributeType.Portfolio
    ) {
      return unfilledSpecialOverrides[8];
    } else if (
      tokenId >= 9002 && tokenId < 9006 && attr == AttributeType.Portfolio
    ) {
      return unfilledSpecialOverrides[9];
    } else if (
      tokenId >= 5555 && tokenId < 5557 && attr == AttributeType.Portfolio
    ) {
      return unfilledSpecialOverrides[10];
    } else if (
      tokenId >= 1338 && tokenId < 1339 && attr == AttributeType.Portfolio
    ) {
      return unfilledSpecialOverrides[11];
    } else if (
      tokenId >= 4520 && tokenId < 4530 && attr == AttributeType.Special
    ) {
      return unfilledSpecialOverrides[12];
    } else if (
      tokenId >= 250 && tokenId < 255 && attr == AttributeType.Special
    ) {
      return unfilledSpecialOverrides[13];
    } else {
      return 0xff;
    }
  }

  function generateAttributeForNewToken(AttributeType attr, uint256 tokenId)
    internal
  {
    uint256[3][] storage _array = getArrayByAttr(attr);

    uint8 sattr = getAttributeValueByRange(attr, tokenId);
    if (sattr != 0xff) {
      setAttributeOfToken(tokenId, attr, sattr);
      _array[sattr][1]++;

      return;
    }

    uint8 kindex = uint8(
      random(uint256(unfilled[uint256(attr)][0] - 1), tokenId)
    );
    uint256 index = uint256(getByte(unfilled[uint256(attr)][1], kindex));

    setAttributeOfToken(tokenId, attr, uint8(index));
    _array[index][1]++;

    if (_array[index][1] == _array[index][2]) {
      removeUnfilled(unfilled[uint256(attr)], kindex);
    }
  }

  function randomId() public view returns (uint256) {
    return random(totalForUsers - 1, block.number);
  }

  function generateToken(uint256 tokenId) internal {
    generateAttributeForNewToken(AttributeType.Age, tokenId);
    generateAttributeForNewToken(AttributeType.Handicap, tokenId);
    generateAttributeForNewToken(AttributeType.Height, tokenId);
    generateAttributeForNewToken(AttributeType.IQ, tokenId);
    generateAttributeForNewToken(AttributeType.Partner, tokenId);
    generateAttributeForNewToken(AttributeType.Penis, tokenId);
    generateAttributeForNewToken(AttributeType.Portfolio, tokenId);
    generateAttributeForNewToken(AttributeType.Race, tokenId);
    generateAttributeForNewToken(AttributeType.Sex, tokenId);
    generateAttributeForNewToken(AttributeType.Special, tokenId);
    generateAttributeForNewToken(AttributeType.Weight, tokenId);
  }

