  function hasBonusToken(address addr) public view returns (bool) {
    return bonusToken.balanceOf(addr) > 0;
  }

  function isWhitelisted(address addr) public view returns (bool) {
    return !bonusUsed[addr] && hasBonusToken(addr);
  }

  function claim(uint256 tokenId) public payable nonReentrant {
    require(tokenId > 0 && tokenId <= totalForUsers, "Token ID invalid");

    if (isWhitelisted(msg.sender)) {
      bonusUsed[msg.sender] = true;
    } else {
      require(msg.value == mintPrice, "Mint fee is not provided");
    }

    _safeMint(_msgSender(), tokenId);
  }

  function setMintPrice(uint256 newPrice) public onlyOwner nonReentrant {
    mintPrice = newPrice;
  }

  function withdraw() public payable onlyOwner nonReentrant {
    payable(owner()).transfer(address(this).balance);
  }

  function ownerClaim(uint256 tokenId) public nonReentrant onlyOwner {
    require(
      tokenId > totalForUsers && tokenId <= totalForOwner,
      "Token ID invalid"
    );
    _safeMint(owner(), tokenId);
  }

  function toString(uint256 value) internal pure returns (string memory) {
    // Inspired by OraclizeAPI's implementation - MIT license
    // https://github.com/oraclize/ethereum-api/blob/b42146b063c7d6ee1358846c198246239e9360e8/oraclizeAPI_0.4.25.sol

    if (value == 0) {
      return "0";
    }
    uint256 temp = value;
    uint256 digits;
    while (temp != 0) {
      digits++;
      temp /= 10;
    }
    bytes memory buffer = new bytes(digits);
    while (value != 0) {
      digits -= 1;
      buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
      value /= 10;
    }
    return string(buffer);
  }
}

